import { Route, Routes } from "react-router-dom";
import Navbar from "./components"

import { 
  Home, 
  Revision, 
  Additions, 
  Transfer,
  Whoops404
} from './pages/pages';

function App() {
  return (
    <div>
        <Routes>
          <Route  path="/" element={<Home/>}/><Route/>
          <Route  path="revision" element={<Revision />}/><Route/>
          <Route  path="additions" element={<Additions />}/><Route/>
          <Route  path="transfer" element={<Transfer />}/><Route/>
          <Route  path="*" element={<Whoops404 />}/><Route/>
        </Routes>
    </div>
  );
}

export default App;
